TITLE:
  - "Cut Cartesian background mesh with a NURBS cut mesh"
PROBLEM TYPE:
  PROBLEMTYPE: "Structure"
  SHAPEFCT: "Nurbs"
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 1
IO/RUNTIME VTK OUTPUT/STRUCTURE:
  OUTPUT_STRUCTURE: true
  DISPLACEMENT: true
  ELEMENT_OWNER: true
  ELEMENT_GID: true
  ELEMENT_GHOSTING: true
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "Statics"
  TIMESTEP: 1
  NUMSTEP: 1
  MAXTIME: 2
  M_DAMP: 1e-05
  K_DAMP: 1e-05
  TOLDISP: 1e-06
  TOLRES: 1e-06
  MAXITER: 15
  LINEAR_SOLVER: 1
SOLVER 1:
  SOLVER: "UMFPACK"
  NAME: "Struct_Solver"
XFEM GENERAL:
  GMSH_DEBUG_OUT: true
  GMSH_CUT_OUT: true
CUT GENERAL:
  GENERAL_POSITION_DISTANCE_FLOATTYPE: "double"
  GENERAL_POSITION_POSITION_FLOATTYPE: "double"
  DO_SELFCUT: false
EMBEDDED MESH COUPLING:
  COUPLING_STRATEGY: mortar
  MORTAR_SHAPE_FUNCTION: nurbs9
  CONSTRAINT_ENFORCEMENT: penalty
  CONSTRAINT_ENFORCEMENT_PENALTYPARAM: 1e+10
MATERIALS:
  - MAT: 1
    MAT_Struct_StVenantKirchhoff:
      YOUNG: 20000
      NUE: 0.3
      DENS: 7.8e-07
